class Solution:
    # @param board, a 2D array
    # Capture all regions by modifying the input board in-place.
    # Do not return any value.
    def fire(self, board, i, j):
        N = len(board)
        M = len(board[0])

        candidates = list()
        candidates.append((i,j))

        while len(candidates) > 0:
            i , j = candidates.pop()
            if i < 0 or j < 0 or i >= N or j >= M or not board[i][j] == 'O':
                continue

            board[i][j] = 'Y'

            candidates.append((i-1,j))
            candidates.append((i+1,j))
            candidates.append((i, j-1))
            candidates.append((i, j+1))


    def solve(self, board):
        if board == None:
            return board

        N = len(board)
        if N == 0:
            return board

        M = len(board[0])

        if N == 0 or M == 0 :
            return board

        for i in range(N):
            board[i] = list(board[i])


        # fire forest all region attached to the wall
        for i in range(N):
            self.fire(board, i, 0)
            self.fire(board, i, M-1)

        for j in range(M):
            self.fire(board, 0, j)
            self.fire(board, N-1, j)

        for i in range(N):
            for j in range(M):
                if board[i][j] == 'Y':
                    board[i][j] = 'O'
                else:
                    board[i][j] = 'X'

        for i in range(N):
            board[i] = "".join(board[i])

        return board

